import { createServer } from 'miragejs';

export default function makeServer({ environment = 'development' } = {}) {
  const CreateServer = createServer({
    environment,
    seeds(server) {
      const serverDB = server.db; // {} the db is empty
      const dbData = localStorage.getItem('db');

      if (dbData) {
        // https://miragejs.com/api/classes/db/#load-data
        serverDB.loadData(JSON.parse(dbData));
      } else {
        serverDB.loadData({
          products: [
            {
              id: 1,
              belongid: 0,
              // pic: 'pickle.jpg',
              // pic: 'https://raw.githubusercontent.com/elzuoc/RePur/main/src/assets/uploads/pickle.jpg',
              pic: 'data:image/jpeg;base64,',
              name: '',
              brand: '',
              price: '200',
              isHighest: true,
              isLowest: false,
              weight: '600',
              unit: 'g',
              sales_channel: '1',
              discount: '2',
              buy_date: '2022-06-22',
            },
            {
              id: 2,
              belongid: 0,
              // pic: 'lemon.jpg',
              pic: 'data:image/jpeg;base64,',
              name: '',
              brand: '',
              price: '45',
              isHighest: true,
              isLowest: false,
              weight: '900',
              unit: 'ml',
              sales_channel: '2',
              discount: '1',
              buy_date: '2022-06-23',
            },
            {
              id: 3,
              belongid: 1,
              // pic: 'pickle.jpg',
              pic: 'data:image/jpeg;base64,',
              name: '',
              brand: '',
              price: '188',
              isHighest: false,
              isLowest: false,
              weight: '600',
              unit: 'g',
              sales_channel: '1',
              discount: '1',
              buy_date: '2022-06-24',
            },
            {
              id: 4,
              belongid: 1,
              // pic: 'pickle.jpg',
              pic: 'data:image/jpeg;base64,',
              name: '',
              brand: '',
              price: '165',
              isHighest: false,
              isLowest: true,
              weight: '600',
              unit: 'g',
              sales_channel: '1',
              discount: '1',
              buy_date: '2022-06-24',
            },
          ],

          channels: [
            {
              id: 1,
              fullname: '',
              shortname: '',
            },
            {
              id: 2,
              fullname: '',
              shortname: '',
            },
            {
              id: 3,
              fullname: 'PCHome24',
              shortname: 'PCHome24',
            },
            {
              id: 4,
              fullname: 'MONO',
              shortname: 'MOMO',
            },
            {
              id: 5,
              fullname: '',
              shortname: '',
            },
          ],
        });
      }
    },

    routes() {
      // all product
      this.get('/api/GET/products', (schema, request) => {
        let mainProds = schema.db.products.filter((item) => item.belongid === 0);

        // query: search
        if (
          Object.prototype.hasOwnProperty.call(request.queryParams, 'search') &&
          request.queryParams.search !== 'null'
        )
          mainProds = mainProds.filter((item) => item.name.includes(request.queryParams.search));

        // query: sort
        if (
          Object.prototype.hasOwnProperty.call(request.queryParams, 'sort') &&
          request.queryParams.sort
        ) {
          mainProds = mainProds.sort((current, next) => {
            let isCurrentLarger = false;

            if (request.queryParams.sortField === 'buy_date') {
              isCurrentLarger =
                new Date(current[request.queryParams.sortField]) >
                new Date(next[request.queryParams.sortField]);
            }

            // console.log('isCurrentLarger', isCurrentLarger);
            console.log('request.queryParams.sortType', request.queryParams.sortType);
            console.log('isCurrentLarger', isCurrentLarger);
            if (
              (request.queryParams.sortType === 'asc' && isCurrentLarger) ||
              (request.queryParams.sortType === 'desc' && !isCurrentLarger)
            )
              return 1;

            return -1;
          });
          console.log('mainProds', mainProds);
        }

        // query: belongid
        if (Object.prototype.hasOwnProperty.call(request.queryParams, 'belongid')) {
          mainProds = schema.db.products.filter(
            (item) => item.belongid === Number(request.queryParams.belongid)
          );
        }

        return mainProds;
      });

      // get one product
      this.get('/api/GET/product/:id', (schema, request) => {
        const { id } = request.params;
        return schema.db.products.findBy({ id });
      });

      // new one product
      let newId = 4;
      this.post('/api/POST/product', (schema, request) => {
        console.log('request', request);
        console.log('schema', schema);
        const attrs = JSON.parse(request.requestBody);
        newId += 1;
        attrs.id = newId;
        console.log('attrs', attrs);
        return schema.db.products.insert(attrs);
      });

      // update one product
      this.patch('/api/PATCH/products/:id', (schema, request) => {
        // console.log(schema, request);
        const newAttrs = JSON.parse(request.requestBody);
        const { id } = request.params;

        return schema.db.products.update(id, newAttrs);
      });

      // channel
      this.get('/api/GET/channels', (schema, request) => {
        let { channels } = schema.db;

        // query: parse
        if (
          Object.prototype.hasOwnProperty.call(request.queryParams, 'parse') &&
          request.queryParams.parse !== 'null'
        )
          channels = channels.findBy({ id: request.queryParams.parse });

        return channels;
      });

      // new one channel
      let newChannelId = 6;
      this.post('/api/POST/channels', (schema, request) => {
        const attrs = JSON.parse(request.requestBody);
        newChannelId += 1;
        attrs.id = newChannelId;

        return schema.db.channels.insert(attrs);
      });

      // update one channel
      this.patch('/api/PATCH/channels/:id', (schema, request) => {
        // console.log(schema, request);
        const newAttrs = JSON.parse(request.requestBody);
        const { id } = request.params;

        return schema.db.channels.update(id, newAttrs);
      });

      // delete one channel
      this.delete('/api/DELETE/channels/:id', (schema, request) => {
        const { id } = request.params;
        return schema.db.channels.remove(id);
      });
    },
  });

  CreateServer.pretender.handledRequest = (verb) => {
    if (verb.toLowerCase() !== 'get' && verb.toLowerCase() !== 'head') {
      localStorage.setItem('db', JSON.stringify(CreateServer.db.dump()));
    }
  };

  return CreateServer;
}
